import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MedicalRecordsList from './components/MedicalRecordsList';
import AddMedicalRecord from './components/AddMedicalRecord';
import PatientList from './components/PatientList';
import AddPatient from './components/AddPatientForm';
import EditPatient from './components/EditPatientForm';


const App = () => {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li><Link to="/patients">Patients</Link></li>
                        <li><Link to="/add-patient">Add Patient</Link></li>
                        <li><Link to="/medical-records">Medical Records</Link></li>
                        <li><Link to="/add-record">Add Medical Record</Link></li>
                    </ul>
                </nav>

                <Routes>
                    <Route path="/patients" element={<PatientList />} />
                    <Route path="/add-patient" element={<AddPatient />} />
                    <Route path="/edit-patient/:id" element={<EditPatient />} />
                    <Route path="/medical-records" element={<MedicalRecordsList />} />
                    <Route path="/add-record" element={<AddMedicalRecord />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
